package com.A09_WhileLoop;

public class A09_MultiplicationTable {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		for(int i=1;i<=12;i++){
			   for(int j=1;j<=12;j++){
				   
			       System.out.print(i*j+"\t");
			       		       
			   }
			   //new line
			 
			   System.out.println("");
			  }
		
	}

}
